import './LoadingScreen.css'
import PuffLoader from "react-spinners/ClipLoader";


function LoadingScreen() {
  return (
    <div className='LoadingScreen'>
        <PuffLoader color="#36d7b7" size="10vw"/>
    </div>
  )
}

export default LoadingScreen
